import pytest
from rest_framework.test import APIClient
from django.urls import reverse
from api.models import ImageFile, PDFFile



@pytest.fixture
def api_client():
    return APIClient()


@pytest.fixture
def base64_image():
    # Create a base64-encoded image
    img_data = "data:image/jpeg;base64,"
    return img_data


@pytest.fixture
def base64_pdf():
    # Create a base64-encoded PDF
    pdf_data = "data:application/pdf;base64,"
    return pdf_data


@pytest.mark.django_db
def test_image_upload(api_client,base64_image):
    # Encode the image in base64
    data = {
        "file": base64_image,
        "file_name": "test_image.jpg",
    }
    response = api_client.post(reverse('file-upload'), data, format='json')
    assert response.status_code == 201
    assert 'width' in response.data
    assert 'height' in response.data
    assert 'channels' in response.data


@pytest.mark.django_db
def test_pdf_upload(api_client, base64_pdf):
    # Encode the PDF in base64
    data = {
        "file": base64_pdf,
        "file_name": "test_pdf.pdf",
    }
    response = api_client.post(reverse('file-upload'), data, format='json')
    assert response.status_code == 201
    assert 'number_of_pages' in response.data
    assert 'page_width' in response.data
    assert 'page_height' in response.data


@pytest.mark.django_db
def test_image_list(api_client):
    ImageFile.objects.create(file='uploads/images/test.jpg', width=100, height=100, channels=3)
    response = api_client.get(reverse('image-list'))
    assert response.status_code == 200
    assert len(response.data) == 1
    assert response.data[0]['width'] == 100
    assert response.data[0]['height'] == 100


@pytest.mark.django_db
def test_pdf_list(api_client):
    PDFFile.objects.create(file='uploads/pdfs/test.pdf', number_of_pages=1, page_width=300, page_height=300)
    response = api_client.get(reverse('pdf-list'))
    assert response.status_code == 200
    assert len(response.data) == 1
    assert response.data[0]['number_of_pages'] == 1
    assert response.data[0]['page_width'] == 300
    assert response.data[0]['page_height'] == 300
